import React from 'react';
import { StockChart } from './components/StockChart';

function App() {
  // Simple test data
  const testData = {
    'TEST': [
      { timestamp: '2024-01-01T10:00:00Z', price: 100 },
      { timestamp: '2024-01-01T11:00:00Z', price: 105 },
      { timestamp: '2024-01-01T12:00:00Z', price: 102 },
    ]
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Stock Chart Test</h1>
      <StockChart 
        data={testData}
        selectedStocks={['TEST']}
        showAverage={false}
      />
    </div>
  );
}

export default App;
